import React, { useState, useEffect } from 'react';
import { BrowserRouter as Router, Route, Routes, Link, Navigate } from 'react-router-dom';
import Home from './Pages/Home';
import Trivia1 from './Pages/Trivia1';
import Profile from './Pages/Profile';
import SignUp from './Pages/Auth'; // Assuming this is the correct import for SignUp
import axios from 'axios';
import Signup2 from './Pages/Signup';
import Questionnaire from './Pages/Question';
import './App.css';

function App() {

  const [loading, setLoading] = useState(true);

  useEffect(() => {
    // Simulating an asynchronous operation (e.g., fetching data from an API)
    // Replace this with your actual asynchronous logic
    setTimeout(() => {
      setLoading(false);
    }, 2000);
  }, []);

  return (
    <Router>
      <div className='web-width-dt'>
        <nav className='head-nav'>




            <Link to="/home">
            <p className='logo'>&#9775;</p>
            </Link>
            <ul className='nav-links'>
              <li>
                <Link to="/auth">Signup</Link>
              </li>
              <li id="middle">
                <Link to="/events">Events</Link>
              </li>
              <li>
                <Link to="/Profile">Profile</Link>
              </li>
            </ul>




        </nav>

        <Routes>
        <Route path="/home" element={<Home loading={loading} />} />
          <Route path="/events" element={<Trivia1 />} />
          <Route path="/Profile" element={<Profile />} />
          <Route path="/auth" element={<SignUp />} />
          <Route path="/signup" element={<Signup2 />} />
        </Routes>
      </div>
    </Router>
  );
}

export default App;
